spring:
  datasource:
    driverClassName: "{cipher}"
    url: "{cipher}"
    username: "{cipher}"
    password: "{cipher}"
  jpa:
    show-sql: true
    properties:
      hibernate:
        dialect: "{cipher}"
        ddl-auto: update
  h2:
    console:
      enabled: true
      settings:
        web-allow-others: true
      path: /h2-console
  rabbitmq:
    host: "{cipher}"
    port: "{cipher}"
    username: "{cipher}"
    password: "{cipher}"
  redis:
    host: "{cipher}"
    port: "{cipher}"

file:
  dir: /root/image/
  url: "{chiper}"

management:
  endpoints:
    web:
      exposure:
        include: health